tables.table_schema:
CREATE TABLE rental_income_expenses (
  property_id INT PRIMARY KEY,
  rental_income DECIMAL,
  expenses DECIMAL,
  report_date DATE
);

CREATE TABLE rental_payments (
  payment_id INT PRIMARY KEY,
  tenant_id INT,
  payment_date DATE,
  amount DECIMAL(10, 2)
);

CREATE TABLE Payments (
    payment_id UUID PRIMARY KEY,
    tenant_id UUID,
    payment_date DATE,
    amount DECIMAL
);
